// SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "../node_modules/@openzeppelin/contracts-upgradeable/token/ERC1155/utils/ERC1155ReceiverUpgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/utils/ContextUpgradeable.sol";
import "../node_modules/@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./Topx.sol";

struct Order {
  address seller;
  uint256 price;
}

contract Marketplace is Initializable, ContextUpgradeable, ERC1155ReceiverUpgradeable {

  Topx public topxInstance;

  mapping(uint256 => Order) public market;

  event OrderCreated(
    address seller,
    uint256 tokenId,
    uint256 price
  );

  event OrderBought(
    address account,
    uint256 tokenId
  );

  event OrderCanceled(
    uint256 tokenId
  );

  function initialize(Topx _topxInstance) public initializer {
    topxInstance = _topxInstance;
  }

  function buyOrder(uint256 tokenId) public payable {
    require(market[tokenId].seller != address(0x0), "There are no open orders for that token");
    Order memory order = market[tokenId];
    require(msg.value >= order.price);
    uint256 creatorRoyalty = topxInstance.getCreatorRoyaltyFromAmountForTokenId(tokenId, msg.value);
    address creator = topxInstance.getCreatorAddressForTokenId(tokenId);
    uint256 artistRoyalty = topxInstance.getArtistRoyaltyFromAmountForTokenId(tokenId, msg.value);
    address artist = topxInstance.getArtistForTokenId(tokenId);
    if (artistRoyalty > 0) {
      payable(artist).transfer(artistRoyalty);
      payable(creator).transfer(creatorRoyalty);
      payable(market[tokenId].seller).transfer(msg.value-artistRoyalty-creatorRoyalty);
    } else {
      payable(creator).transfer(creatorRoyalty);
      payable(market[tokenId].seller).transfer(msg.value-creatorRoyalty);
    }
    topxInstance.safeTransferFrom(address(this), _msgSender(), tokenId, 1, '0x');
    emit OrderBought(_msgSender(), tokenId);
  }

  function cancelOrder(uint256 tokenId) public {
    require(market[tokenId].seller != address(0x0), "There are no open orders for that token");
    Order memory order = market[tokenId];
    require(order.seller == _msgSender());
    topxInstance.safeTransferFrom(address(this), _msgSender(), tokenId, 1, '0x');
    emit OrderCanceled(tokenId);
  }

  function addOrder(uint256 tokenId, uint256 price) public {
    require(market[tokenId].seller == address(0x0), "There already is an open order for that token");
    topxInstance.safeTransferFrom(_msgSender(), address(this), tokenId, 1, '0x');
    market[tokenId] = Order(_msgSender(), price);
    emit OrderCreated(_msgSender(), tokenId, price);
  }

  function getOrder(uint256 tokenId) public view returns ( address, uint256 ) {
    require(market[tokenId].seller != address(0x0), "There are no open orders for that token");
    Order memory order = market[tokenId];
    return (order.seller, order.price);
  }

  function onERC1155Received(
    address operator,
    address from,
    uint256 id,
    uint256 value,
    bytes calldata data
  ) external override pure returns (bytes4) {
    return (
      bytes4(
        keccak256(
          "onERC1155Received(address,address,uint256,uint256,bytes)"
        )
      )
    );
  }

  function onERC1155BatchReceived(
    address operator,
    address from,
    uint256[] calldata ids,
    uint256[] calldata values,
    bytes calldata data
  ) external override pure returns (bytes4) {
    revert();
    return "";
  }   
}
